import './Video.scss';
import '../../assets/Data/video-details.json'


function VideoRender({ renderedVideo }) {
    return (
        <section className='video-rendered'>
            <video poster={renderedVideo.image}>
                <h1>{renderedVideo.title}</h1>
                <h3>{renderedVideo.channel}</h3>
                <p>{renderedVideo.timestamp}</p>
            </video>
        </section>
    );
}

export default VideoRender;
